import React from "react";
import Form from "../Components/Form";

const Contact = () => {
  return (
    <div>
      <div className="contact">
        <h2>¿Quieres saber más?</h2>
        <p>
          Envíanos tus preguntas y nos <br></br>
          pondremos en contacto contigo
        </p>
      </div>
      <Form />
    </div>
  );
};

export default Contact;
